import React from 'react'



const AboutUs = (props) => {

    return ( 

        <> 
            <p className="position-absolute top-50 start-50 translate-middle">
               Hi! welcome to our website. Here you will be able<br/>  
               to see our work and updates to future events.<br/><br/>

               We are the Polytechnics University ETSISI sports club based in Madrid Spain<br/>, a group of people who want to become<br/> the best version of themselves, 
               a <em><strong>comunity</strong></em> to <em><strong>inspire</strong></em> and to work <em><strong>together</strong></em> to get to wherever we want.<br/><br/>

               follow us on instagram: <a rel="noreferrer" target="_blank" href="https://www.instagram.com/cdetsisi/?hl=en">@cdetsisi</a><br/>
               our events <a rel="noreferrer" target="_blank" href="https://linktr.ee/cdetsisi">here</a><br/>



            </p>
        </>
     );
}

export default AboutUs;
